    [],nt"revision_timestamp": "2015-07-08T19:14:11.874835",nt"name": "gridded-population-of-the-world-version-3-gpwv3-population-density-grid",nt"isopen":
    true,nt"url": null,nt"notes": "Gridded Population of the World, Version
    3 (GPWv3) consists of estimates of human population for the years 1990, 1995, and
    2000 by 2.5 arc-minute grid cells and associated nndatasets dated circa 2000. A
    proportional allocation gridding algorithm, utilizing more than 300,000 national
    and sub-national administrative units, is used to assign population values to nngrid
    cells. The population density grids are derived by dividing the population count
    grids by the land area grid and represent persons per square kilometer. The grids
    are available in nnvarious GIS-compatible data formats and geographic extents (global,
    continent [Antarctica not included], and country levels). GPWv3 is produced by the
    Columbia University Center for nnInternational Earth Science Information Network
    (CIESIN) in collaboration with Centro Internacional de Agricultura Tropical (CIAT).",nt"license_title":
